autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1959734","type":"CustomJS"},{"attributes":{"active_drag":{"id":"1959604"},"active_scroll":{"id":"1959605"},"tools":[{"id":"1959604"},{"id":"1959605"},{"id":"1959606"},{"id":"1959607"},{"id":"1959608"},{"id":"1959609"},{"id":"1959610"},{"id":"1959627"},{"id":"1959735"}]},"id":"1959612","type":"Toolbar"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwP94/S5QTDvA/h/pRHN077z+1sMbhnB3vP4RI3YpY9u4/9f1lknD87j98z2WQ2f7uP6GR6RHhJu4/vajns7Q57j9sSWra6hbuP+jEDhy0tO0/EWqXpCZJ7j+uhWD9KZruP6HbtZCBre4/MUVwFaji7j+f8GGZr3DuP4xxs73zgu4/MmXFUIwc7j8G9IJdwvnsPzll56g8Be0/MQsIFpA57T94PhTxg0/tP8HlIbshee0/UKFNrwhu7T91JVNlXr7tPyWtk6T7uu0/R7fQcYt77T864D7kCRrtP+17ZJ0w5Ow/QMoVkTKo7D+2eB7NctjsPz1s8vkAq+w/fuSb1CyM7D81b2u2qkjsP/0ma5DdF+w/BvXXKeLt6z/YmrIsf6LrP1u/KtdX5+s/+5ETdUCc6z85iP2boFjrP7GgkXYFdes/VUCKAsmg6z81uV387RrsP6lzg9YAi+s/HB+hJCxT6z/aMvJ9oufqP8pQhjqNzOo/mHnAJRGE6j9IELGmks/qP10tDfCjueo/HZmslwhn6z8Z6jfYAifrP5OyQD5XWes/CALubB2i6z8yv9avuHvrP/kMd0cp1eo/eYMbaL/n6j+UDLR9d0vrP5SD2wVDsOo/xPQGXZdB6j98XAvac9fpPygKMaQ1cOk/lBH54Mx+6T+YGv6iZrnpP2WkHQGc2uk/eQ6X4svg6T+3PmobmB/qP4US2jASk+o/lUFkeopI6j8ZikWZd//pP+V1lDEkYek/sTTKJZeA6T/UslImzCvpP1tC3nWtEuk/ksEL1MLi6D/39Yv4n9PoPyTxpuZoUek/Cp/jLLd36D/HW/h
